import React from "react";
import { Route, Redirect } from "react-router-dom";
import { useSelector } from "react-redux";
import { isLoggedIn } from "../../utils/helper";
// import { userLoginProcess } from "../../actions/user";

const PrivateRoutes = ({ component: Component, ...rest }) => {
  const { isAuthenticated/*, isLoading*/ } = useSelector(state => state.userLogin);
  const udData = useSelector(state => state.userLogin);
  const uddDate = (JSON.parse(udData.userDetails)) ? JSON.parse(udData.userDetails) : localStorage.getItem('userDetails') ;
  console.log("Login ",uddDate.user_type)
  if(uddDate.user_type == "admin"){
    return <Route {...rest} render={(props) => ((isLoggedIn() || isAuthenticated) ?  <Component {...props} /> : <Redirect to="/login" />)} />; 
  } else {
    return ''; 
  }
};

export default PrivateRoutes;
